import React from 'react'
import './project.css'
const Project = ({ id, image, title, description, tags, source, visit}) => {
  return (
    <div className='project__card'>

        <h2>{title}</h2>
        <img src={image} />
        <p>{description}</p>
        {tags.map((tag) => (
          <p>{tag}</p>
        ))}
        <p>{source}</p>
    </div>
  )
}

export default Project
